import { zodFunction } from "openai/helpers/zod";
import type { ChatCompletionMessageParam } from "openai/resources/index.mjs";
import { z } from "zod";
import { openRouterAPI } from "./src/utils/request";

const messages = [
	{
		role: "system",
		content:
			"call the tool process_image with the image base64 to process the image",
	},
	{
		role: "user",
		content: [
			{
				type: "image_url",
				image_url: {
					url: "data:image/png;base64,",
				},
			},
			{
				type: "text",
				text: "can you process this image",
			},
		],
	},
] as ChatCompletionMessageParam[];

const generateResponse = async () => {
	const tools = [
		{
			name: "process_image",
			parameters: z.object({
				imageBase64: z.string(),
			}),
			description: "Process an image",
		},
	];
	const completion = await openRouterAPI.beta.chat.completions.parse({
		model: "google/gemini-2.0-flash-001",
		messages,
		tools: tools.map((tool) =>
			zodFunction({
				name: tool.name,
				parameters: tool.parameters,
				description: tool.description,
			}),
		),
	});

	console.log(JSON.stringify(completion, null, 2));

	const toolCalls = completion.choices.at(0)?.message.tool_calls;
	if (!toolCalls) return;

	for (const toolCall of toolCalls) {
		if (toolCall.function.name !== "get_weather") continue;
		console.log(toolCall.function.parsed_arguments);
	}
};

generateResponse().catch(console.error);
